import React from "react";
import "./navbar.css";
import { Link } from "react-router-dom";

const NavBar = () =>{
    return(
        <div>
            <Link to="/">Home</Link>
            <Link to="/shop">Shop</Link>
            <Link to="/cart">Cart</Link>
        </div>
    )
}

export default NavBar
